import React from 'react'
import './ChimpTest.css';
import { Button } from 'react-bootstrap';

export default function ChimpTest() {
  return (
    <>
    <div className="title">
        Monkey
    </div>
    <ButtonGroup variant="contained" aria-label ="outlined primary button group">
      <Button>1</Button>
      <Button>2</Button>
      <Button>3</Button>
      <Button>4</Button>
      <Button>5</Button>
    </ButtonGroup>
    </>
  )
}
